<html xmlns="http://www.w3.org/1999/xhtml"><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"><title></title><style type="text/css">body {margin-left: 0px;margin-top: 0px;margin-right: 0px;margin-bottom: 0px;}</style></head><body>
<script language="javascript" type="text/javascript">
try{
  function GetURLParam(p){
      var rs = "[\?&]"+p+"=([^&#]*)";
      var regex = new RegExp(rs);
      var results = regex.exec(window.location.href);
      if(results == null || results.length != 2){ return ""; } else { return results[1]; }
  }
  parent.parent.Report(GetURLParam("i"),GetURLParam("r"),GetURLParam("e"),GetURLParam("o"));
}
catch(err)
{}
</script>

</body></html>
